import React, { useState } from 'react';

function Dashboard() {
    const [sidebar, setSideBar] = useState(false);

    return (
        <div className={sidebar ? 'main-content active' : 'main-content'}>
                <h1>Dashboard</h1>
                <p>this is dashboard</p>
            </div>
    )
}

export default Dashboard
